<template>
  <text :style="{ color: color, 'font-size': size + 'px' }" class="my-icons" @click="_onClick">{{icons[type]}}</text>
</template>

<script>
  import icons from './icons.js';
  // #ifdef APP-NVUE
  var domModule = weex.requireModule('dom');
  domModule.addRule('fontFace', {
    'fontFamily': "myicons",
    'src': url('data:font/truetype;charset=utf-8;base64,')
  });
  // #endif
  export default {
    name: 'myIcons',
    props: {
      type: {
        type: String,
        default: ''
      },
      color: {
        type: String,
        default: '#333333'
      },
      size: {
        type: [Number, String],
        default: 16
      }
    },
    data() {
      return {
        icons: icons
      }
    },
    methods: {
      _onClick() {
        this.$emit('click')
      }
    }
  }
</script>

<style lang="scss" scoped>
  /* #ifndef APP-NVUE */
  @font-face {
    font-family: myicons;
    src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
  }

  /* #endif */

  .my-icons {
    font-family: myicons;
    text-decoration: none;
    text-align: center;
  }
</style>
